// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;
contract MultiSigWallet{
    address[] public owner;
    mapping (address=>bool) public isOwner;
    uint256 public required;//需要多少个人同意
    struct Transaction{
        address from;
        address to;
        uint256 values;
        bytes data;
        bool exected;
    }
    event Deposit(address indexed sender, uint256 amount);
    event Submit(uint256 indexed txId);
    event Approve(address indexed owner, uint256 indexed txId);
    event Revoke(address indexed owner, uint256 indexed txId);
    event Execute(uint256 indexed txId);
    receive() external payable { 
        emit Deposit(msg.sender, msg.value);
    }
    fallback() external payable { }

    constructor(address[] memory _owner,uint256  _required) {
        require(_owner.length >_required ,"must > required");
        require(_required>0,"invaild required number of required");
        for (uint i=0; i<_owner.length; i++) 
        {   require(_owner[i] != address(0),"invalid address");
            require(isOwner[_owner[i]] !=true,"owner is not unique");
            isOwner[_owner[i]] = true;
            owner.push(_owner[i]);
        }
        required = _required;
    }
    function getBalance()public view  returns (uint256){
        return address(this).balance;
    }
}

